pragma solidity ^0.4.24;

import "../security/AccessRestriction.sol";

contract StorageInterface {
  function totalKey() public view returns (uint256);
  function getNewKey() external returns (uint256);
  function setString(uint256 _key,string _attriName,string _value) external;
  function getString(uint256 _key,string _attriName) public view returns (string);
}


contract MetaDataController is AccessRestriction {
  StorageInterface storageContract;

  function setStorageContractAddress(address _address) public onlyOwner {
    storageContract = StorageInterface(_address);
  }

  function addNewBook(string _name, string _isbn) public returns(uint256) {
    // Validate data
    uint256 newKey = storageContract.getNewKey();
    storageContract.setString(newKey, "name", _name);
    storageContract.setString(newKey, "isbn", _isbn);
    return newKey;
  }

  function getBookByKey(uint256 _key) public view returns(string, string) {
    return (storageContract.getString(_key, "name"), storageContract.getString(_key, "isbn"));
  }

}
